import Aux from "../../hoc/Aux/Aux";
import "./Landing.css";
class Landing extends Component {
  render() {
    return (
      <Aux>
        <form className="hii">
          <input type="text" placeholder="Search.."></input>
          <button type="submit">Submit</button>
        </form>
      </Aux>
    );
  }
}
export default Landing;
